Description:
- We need someone who can understand: Cloud computing, software development (full-stack), Project management; Interested in business. 
- We will co-operate for long term; senior profiles needed; 
- Can start to work for part time, but he/she needs to take full responsibility for managing this project.

Mô tả công việc 
Tham gia phát triển các ứng dụng Blockchain sử dụng trên nền tảng Ethereum/HyperLedger; 
Tham gia vào toàn bộ quá trình phát triển sản phẩm Blockchain và nhóm nghiên cứu về Blockchain; 
Tham gia vào các seminar, sự kiện, hội thảo Blockchain lớn, uy tín được tổ chức trong và ngoài công ty; 
Các công việc khác theo chỉ đạo của quản lý trực tiếp; 
Công việc sẽ được trao đổi cụ thể hơn trong quá trình phỏng vấn.

Mô tả công việc 
Tham gia phát triển các ứng dụng Blockchain sử dụng trên nền tảng Ethereum/HyperLedger; 
Tham gia vào toàn bộ quá trình phát triển sản phẩm Blockchain và nhóm nghiên cứu về Blockchain; 
Tham gia vào các seminar, sự kiện, hội thảo Blockchain lớn, uy tín được tổ chức trong và ngoài công ty; 
Các công việc khác theo chỉ đạo của quản lý trực tiếp; 
Công việc sẽ được trao đổi cụ thể hơn trong quá trình phỏng vấn.

1.TỔNG QUAN VỀ CÔNG VIỆC VÀ TRÁCH NHIỆM 
- Xử lý các vấn đề an toàn người dùng liên quan đến gian lận, lừa đảo, nội dung bất hợp pháp; 
- Thiết kế và đánh giá các tính năng bảo mật về bảo vệ tài khoản, quyền riêng tư và các lỗi bảo mật của sản phẩm của chúng tôi; 
- Phụ trách các vấn đề liên quan đến gửi thư rác, quét và ngăn chặn việc lạm dụng hoặc khai thác các luồng logic của sản phẩm của chúng tôi; 
- Tập trung phát triển các công cụ để dự đoán, phát hiện và ngăn chặn các vấn đề an toàn & bảo mật bằng cách xử lý, làm sạch, xác minh tính toàn vẹn của dữ liệu được sử dụng để phân tích; 
- Thực hiện đánh giá rủi ro, xem xét chính sách và đo lường mức độ trưởng thành của các luồng an toàn / bảo mật của chúng tôi. 
2. KỸ NĂNG VÀ KINH NGHIỆM CẦN THIẾT 
- Bằng cử nhân về Khoa học máy tính, Bảo mật thông tin hoặc có liên quan đã nộp hồ sơ; 
- Có kinh nghiệm với ít nhất một Ngôn ngữ: Java, Python, C, Go; 
- Có kinh nghiệm thực tế về An toàn thông tin; 
- Có kinh nghiệm ở một vai trò tương tự và tại một công ty dựa trên Internet; 
- Những đóng góp cho cộng đồng bảo mật là một điểm cộng (nghiên cứu công khai, viết blog, thuyết trình, v.v.); 
- Phải có kiến thức về rủi ro bảo mật: tập trung vào kỹ thuật xã hội, bảo vệ quyền riêng tư, xử lý sự cố; 
- Có kinh nghiệm phân tích nhật ký, trích xuất và giải thích dữ liệu từ nhiều nguồn khác nhau; 
- Kiến thức kỹ thuật chi tiết về thủ thuật khai thác PC / Web / Mobile, cơ sở dữ liệu; 
- Hiểu biết kỹ lưỡng về Unix, cơ bản về script, python; 
- Có ý thức và hiểu biết về tính năng bảo mật và yêu cầu riêng tư trên ứng dụng; 
- Có tư duy logic tốt, kỹ năng giải quyết vấn đề và khả năng chịu áp lực công việc.

We are looking for DevOps Engineers to support us in this transition path, dealing with: 
· Within our agile squad, contribute to the definition of architectures and the automation of operations of all phases of the software life cycle; 
· Contribute to the construction and improvement of monitoring tools essential to establish a direct line between production and development teams, facilitate troubleshooting and disseminate a data-driven operating model throughout the organization; 
· Accelerate the transition to the cloud by defining operational models that favor the autonomy of development teams while maintaining control over the critical elements of the operational paradigm (security and privacy, scalability, costs, etc.) 
You are suitable for the position if you have: 
· At least 3 years of experience in managing Unix / Linux systems in continuous production environments; 
· At least 2 years of experience in managing cloud infrastructures provided by a major provider; 
· Experience in defining, implementing, deploying and delivering software architectures based on the Docker / Kubernetes stack or equivalent implementation provided by third parties; 
· Experience in the preparation and maintenance of application monitoring stack for cloud or on-premise architectures, preferably with alerting mechanisms; 
· Knowledge of the main CI / CD toolchains and tools for the automation of configuration and deployment of software and infrastructure as code; 
· Good knowledge of English (CEFR reference B1).
